import React, { Component } from 'react';
import Popup from "reactjs-popup";
import BurgerIcon from "./BurgerIcon";
import { bounceInRight } from 'animate.css';
import Menu from "./Menu";
import "./index.css";
import "./hamburger.css";
import logo from "./logo_1.png"
import { ReactComponent as LogoVector } from "./logo_2.svg"
import { library } from '@fortawesome/fontawesome-svg-core'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faStroopwafel, faFont } from '@fortawesome/free-solid-svg-icons'
import Particles from 'particles.js';
import BackgroundStyle from "./backgroundstyle.css"

const linkedin = () => (
  <div>
    Linkedin: <FontAwesomeIcon icon ="linkedin-in"/>
    </div>
)

const github = () => (
  <div>
    Github: <FontAwesomeIcon icon ="github"/>
    </div>
)

const dribble = () => (
  <div>
    Dribble: <FontAwesomeIcon icon="dribbble"/>
    </div>
)

class Icons extends Component {
  render() {
    return (
      <div>
        <div><i className={linkedin}></i></div>  
        <div><i className={github}></i></div>  
        <div><i className={dribble}></i></div> 
        </div>
    )
  }
}


const styles = {
  background: "rgba(50,50,50)",
  fontFamily: "Avenir Next",
}

const contentStyle = {
  background: "rgba(255,255,255,0)",
  color: "white",
  width: "80%",
  border: "none"
};


class Title extends Component {
  render() {
    return (
      <div>
        <h1 className="Hello" style={bounceInRight}>Hello</h1>
        <img className="logo" src={logo} alt="Logo"></img>
        <p className="welcome-l">welcome   to   my</p>
        <p className="life">LIFE</p>
      </div>

    )
  }
}


class Clogo extends Component {
  render() {
    return (
      <div className="left-logo">
        <p className="C-logo"> C</p>
        <p className="Name-Logo"> ole Critchfield</p>
      </div>
    )
  }
}

/** const Background = props => (
  <div className="BackgroundStyle.Background">
    <Particles
      params={{
        "particles": {
          "number": {
            "value": 50
          },
          "size": {
            "value": 3
          }
        },
        "interactivity": {
          "events": {
            "onhover": {
              "enable": true,
              "mode": "repulse"
            }
          }
        }
      }} />
  </div>
)*/


class App extends Component {
  render() {
    return (

      <div style={styles}>
        <div className="main">
          <Popup
            modal
            overlayStyle={{ background: "#292929" }}
            contentStyle={contentStyle}
            closeOnDocumentClick={false}
            trigger={open => <BurgerIcon open={open} />}
          >
            {close => <Menu close={close} />}
          </Popup>

        </div>
      </div>

    )
  }
}

class Main extends Component {
  render() {
    return (
      <body>
        <div>
          <Icons />
          <div>
            <Clogo />
          </div>
          <Title />
          <LogoVector className="logoVector" />
        </div>
        <App />
      </body>
    )
  }
}




export default Main;
